          </div>
        </div>
        <div>
          <div className="flex flex-col items-center justify-center rounded-2xl w-48 bg-[#f5f5f5] h-38 p-6 box-shadow">
            <img src={Group38} alt="Local Service" />
          </div>
          <div>
            <h4 className="text-3xl py-6 px-6 text-gray-400 h">Local</h4>
          </div>
        </div>
        <div>
          <div className="flex flex-col items-center justify-center rounded-2xl w-48 bg-[#f5f5f5] h-38 p-6 box-shadow">
            <img src={Group38} alt="Local Service" />
          </div>
          <div>
            <h4 className="text-3xl py-6 px-6 text-gray-400 h">Local</h4>
          </div>
        </div>
      </div>
    </div>
  </Carousel>
);
